sys_variable_value.value:
(function execute(inputs, outputs) {

  var input_table = inputs.table;
  var input_conditions = inputs.conditions.toString();
  var input_field = inputs.field;

  var ag = new GlideAggregate(input_table);

  ag.addEncodedQuery(input_conditions);
  ag.setGroup(false);
  ag.addAggregate('COUNT', input_field);
  ag.addAggregate('SUM', input_field);

  ag.query();

  if (ag.next()) {
    outputs.count = ag.getAggregate('COUNT', input_field);
    outputs.sum = ag.getAggregate('SUM', input_field);
  }


})(inputs, outputs);

